import React, {Component} from 'react';

class Todos extends Component{
    state= {
        todos: [
            {
                id:1,
                title: 'Create A Componant',
                completed: false
            },
            {
                id:2,
                title: 'Import it in App.js',
                completed: false
            },
            {
                id:3,
                title: 'App.js will be rendered in index.js',
                completed: false
            }
        ]
    }

    render(){
        return (
        <div>
            <h1>Todos</h1>
        </div>
        );
    }
}

export default Todos;
